oxy_webhelp_navlinks = {"installation-d807e493":{"topics":[{"title":"Choosing the correct location for the EV-Charger","shortdesc":"<p class=\"shortdesc\">Once you have chosen a suitable location, you need to mount the EV-Charger on the wall using the mounting brackets and screws provided. Make sure the EV-Charger is securely mounted and level.<\/p>","href":"topics\/choosing_the_correct_location_for_the_ev-charger_2.html","attributes":{"data-id":"choosing-the-correct-location-for-the-ev-charger"},"menu":{"hasChildren":false},"tocID":"choosing-the-correct-location-for-the-ev-charger-d807e504","topics":[]},{"title":"Mounting the EV-Charger on the Wall","shortdesc":"<p class=\"shortdesc\">To mount the EV-Charger on the wall, follow these steps:<\/p>","href":"topics\/mounting_the_ev-charger_on_the_wall_2.html","attributes":{"data-id":"mounting-the-ev-charger-on-the-wall"},"menu":{"hasChildren":false},"tocID":"mounting-the-ev-charger-on-the-wall-d807e515","topics":[]},{"title":"Connecting the EV-Charger to the electrical system","shortdesc":"<p class=\"shortdesc\">Connect the EV-Charger to the electrical system using the power cord and plug. Follow the instructions in the user manual to ensure that the wiring is correct.<\/p>","href":"topics\/connecting_the_ev-charger_to_the_electrical_system_2.html","attributes":{"data-id":"connecting-the-ev-charger-to-the-electrical-system"},"menu":{"hasChildren":false},"tocID":"connecting-the-ev-charger-to-the-electrical-system-d807e526","topics":[]},{"title":"Testing the EV-Charger","shortdesc":"<p class=\"shortdesc\">Once the EV-Charger is installed, you need to test it to ensure that it is working properly. Connect the charging cable to your electric vehicle and press the start button on the EV-Charger. The display screen should show the charging status and estimated time to full charge.<\/p>","href":"topics\/testing_the_ev-charger_2.html","attributes":{"data-id":"testing-the-ev-charger"},"menu":{"hasChildren":false},"tocID":"testing-the-ev-charger-d807e537","topics":[]}]}};